import './App.css';
import Navigation from './components/Navigation';
import Menu from './components/Menu';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Profil2 from './components/pages/profil/Profil2';
import Disciplina2 from './components/pages/disciplina/Disciplina2';
import Main from './components/pages/main/Main';
import Chart from "react-apexcharts";

function App() {
  return (
    <div>
      <Navigation />
      
      <div className='row'>
        <Menu/>
        <div className=''>
          <BrowserRouter>
            <Routes>
              <Route path='/' element={<Main />} />
              <Route path='/profil' element={<Profil2 />} />
             
              <Route path='/disciplina' element={<Disciplina2 />} />
            </Routes>
          </BrowserRouter>
        </div>
      </div>
    </div>
  );
}

export default App;
